package keyWords;

public class Break {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		 int i=5;  
		    while(i<=100){  
		        if(i==50){  
		            
		           i++;  
		            break; 
		        }  
		        System.out.println(i);  
		        i++;  
		    }
	

	}

}
